from flask import Flask, render_template, request, redirect, url_for, flash, send_from_directory
from werkzeug.utils import secure_filename
import os
import csv
from datetime import datetime
from functools import wraps

app = Flask(__name__)
app.config['SECRET_KEY'] = 'secretkey'
app.config['UPLOAD_FOLDER'] = 'uploads'
app.config['PUBLISHED_FOLDER'] = 'published'
app.config['ALLOWED_EXTENSIONS'] = {'csv'}

# Sample data structures
users = {
    'submitter': {'role': 'submitter', 'agency': 'EPA'},
    'validator': {'role': 'validator', 'agency': None},
    'consumer': {'role': 'consumer', 'agency': None}
}

submissions = []
published_files = []
validation_rules = [
    "Required fields: agency, date, value",
    "Date format: YYYY-MM-DD",
    "Value must be numeric"
]

def login_required(role=None):
    def decorator(f):
        @wraps(f)
        def decorated_function(*args, **kwargs):
            # Simplified auth - in real app you'd have proper auth
            user_role = request.args.get('role', 'consumer')
            if role and users.get(user_role, {}).get('role') != role:
                flash('Unauthorized')
                return redirect(url_for('home'))
            return f(*args, **kwargs)
        return decorated_function
    return decorator

def allowed_file(filename):
    return '.' in filename and \
           filename.rsplit('.', 1)[1].lower() in app.config['ALLOWED_EXTENSIONS']

@app.route('/')
def home():
    return render_template('home.html')

@app.route('/resources')
def resources():
    return render_template('resources.html')

@app.route('/help')
def help_page():
    return render_template('help.html')

@app.route('/fabs')
def fabs_landing():
    return render_template('fabs_landing.html')

@app.route('/dabs')
def dabs_landing():
    return render_template('dabs_landing.html')

@app.route('/submission/dashboard')
@login_required(role='submitter')
def submission_dashboard():
    user_agency = users.get(request.args.get('role'), {}).get('agency')
    user_submissions = [s for s in submissions if s['agency'] == user_agency]
    return render_template('submission_dashboard.html', submissions=user_submissions)

@app.route('/submission/new', methods=['GET', 'POST'])
@login_required(role='submitter')
def new_submission():
    if request.method == 'POST':
        if 'file' not in request.files:
            flash('No file selected')
            return redirect(request.url)

        file = request.files['file']
        if file.filename == '':
            flash('No file selected')
            return redirect(request.url)

        if file and allowed_file(file.filename):
            filename = secure_filename(file.filename)
            timestamp = datetime.now().strftime("%Y%m%d_%H%M%S")
            unique_filename = f"{timestamp}_{filename}"
            filepath = os.path.join(app.config['UPLOAD_FOLDER'], unique_filename)
            file.save(filepath)

            submission = {
                'id': len(submissions) + 1,
                'filename': unique_filename,
                'agency': users.get(request.args.get('role'), {}).get('agency'),
                'status': 'submitted',
                'date': datetime.now().strftime("%Y-%m-%d"),
                'filepath': filepath
            }
            submissions.append(submission)
            flash('Submission created successfully')
            return redirect(url_for('submission_dashboard', role='submitter'))

    return render_template('new_submission.html')

@app.route('/submission/publish/<int:submission_id>')
@login_required(role='submitter')
def publish_submission(submission_id):
    submission = next((s for s in submissions if s['id'] == submission_id), None)
    if submission:
        # In a real app, would validate before publishing
        published_file = {
            'id': len(published_files) + 1,
            'filename': submission['filename'],
            'agency': submission['agency'],
            'publish_date': datetime.now().strftime("%Y-%m-%d"),
            'filepath': os.path.join(app.config['PUBLISHED_FOLDER'], submission['filename'])
        }
        published_files.append(published_file)
        submission['status'] = 'published'
        flash('Submission published successfully')
    else:
        flash('Submission not found')
    return redirect(url_for('submission_dashboard', role='submitter'))

@app.route('/files/published')
@login_required()
def view_published_files():
    agency_filter = request.args.get('agency')
    filtered_files = published_files
    if agency_filter:
        filtered_files = [f for f in published_files if f['agency'] == agency_filter]
    return render_template('published_files.html', files=filtered_files)

@app.route('/files/download/<filename>')
@login_required()
def download_file(filename):
    return send_from_directory(app.config['PUBLISHED_FOLDER'], filename)

@app.route('/validation/rules')
@login_required(role='validator')
def view_validation_rules():
    return render_template('validation_rules.html', rules=validation_rules)

@app.route('/validation/run/<int:submission_id>')
@login_required(role='validator')
def run_validation(submission_id):
    submission = next((s for s in submissions if s['id'] == submission_id), None)
    if submission:
        try:
            with open(submission['filepath'], 'r') as f:
                reader = csv.DictReader(f)
                for row in reader:
                    # Simple validation checks
                    if not row.get('agency') or not row.get('date') or not row.get('value'):
                        submission['status'] = 'validation_failed'
                        flash('Validation failed: Missing required fields')
                        return redirect(url_for('submission_dashboard', role='validator'))

                    try:
                        float(row['value'])
                    except ValueError:
                        submission['status'] = 'validation_failed'
                        flash('Validation failed: Invalid value format')
                        return redirect(url_for('submission_dashboard', role='validator'))

                submission['status'] = 'validation_passed'
                flash('Validation passed successfully')
        except Exception as e:
            submission['status'] = 'validation_failed'
            flash(f'Validation failed: {str(e)}')
    else:
        flash('Submission not found')

    return redirect(url_for('submission_dashboard', role='validator'))

if __name__ == '__main__':
    os.makedirs(app.config['UPLOAD_FOLDER'], exist_ok=True)
    os.makedirs(app.config['PUBLISHED_FOLDER'], exist_ok=True)
    app.run(debug=True)
